import './App.css';
import Navbar from './Components/Navbar/Navbar';
import Logo from './Components/Logo/Logo';
import Search from './Components/Search/Search';

function App() {
  return (
    <div className="App">
     <Navbar />
     <Logo />
     <Search/>
    </div>
  );
}

export default App;
